    "OrderTxt": {                                     "en": "Here you can change the order of the columns. As additional column ts (timestamp) is always added. In VIS etc. simply hide it if necessary.", "de": "Hier kann die Reihenfolge der einzelnen Spalten verändert werden. Als zusätzliche Spalte wird immer ts (timestamp) hinzugefügt. In VIS usw. bei Bedarf einfach ausblenden.<br>Falls du weniger als 4 Spalten brauchst: Wähle einfach einen Eintrag der ersten Spalten aus, die du brauchst, und blende den Rest dann mit dem VIS JSON-Table-Widget (o.ä.) aus.", "ru": "Здесь вы можете изменить порядок столбцов. ",      "pt": "Aqui você pode alterar a ordem das colunas. ",     "nl": "Hier kunt u de volgorde van de kolommen wijzigen. ", "fr": "Ici, vous pouvez modifier l'ordre des colonnes. ", "it": "Qui puoi cambiare l'ordine delle colonne. ",       "es": "Aquí puede cambiar el orden de las columnas. ",    "pl": "Tutaj możesz zmienić kolejność kolumn. Jako dodatkowe kolumny TC (etykiety) zawsze dodaje. W висе itp. po prostu ukryć go w razie potrzeby.", "uk": "Тут ви можете змінити порядок колонок. Як додатковий стовпець ts (мітка часу) завжди додається. У VIS тощо просто приховайте його, якщо потрібно.", "zh-cn": "在这里你可以改变的顺序列。 作为额外的列ts(timestamp)始终加入。 在对等。 只是隐藏它，如果有必要的。"},
