    "ParserRules.Welcome": {                          "en": "Welcome to the Log Parser Adapter. Current ioBroker Forum thread", "de": "Willkommen beim Log-Parser-Adapter. Aktueller ioBroker-Forum-Artikel", "ru": "Добро пожаловать в адаптер анализатора журналов. ", "pt": "Bem-vindo ao Log Parser Adapter. ",                "nl": "Welkom bij de Log Parser Adapter. ",               "fr": "Bienvenue dans l'adaptateur Log Parser. ",         "it": "Benvenuto in Log Parser Adapter. ",                "es": "Bienvenido al adaptador Log Parser. ",             "pl": "Witamy w adapterze parsera dziennika. ",           "uk": "Ласкаво просимо до адаптера аналізатора журналів. Поточна тема форуму ioBroker", "zh-cn": "欢迎使用Log Parser适配器。"},
    "Prepended text (# is replaced by number)": {     "en": "Prepended text (# is replaced by number)",         "de": "Vorangestellter Text (# wird durch Anzahl ersetzt)", "ru": "Предварительно добавленный текст (# заменяется номером)", "pt": "Texto anexado (# é substituído pelo número)",      "nl": "Voorbereide tekst (# wordt vervangen door nummer)", "fr": "Texte ajouté (# est remplacé par un numéro)",      "it": "Testo preposto (# è sostituito dal numero)",       "es": "Texto anexado (# se reemplaza por número)",        "pl": "Poprzedzony tekst (# zamień na liczbę)",           "uk": "Доданий текст (# замінюється числом)",             "zh-cn": "添加的案文(#替换为数)"},
