    "Remove PID": {                                   "en": "Remove PID",                                       "de": "PID entfernen",                                    "ru": "Удалить PID",                                      "pt": "Remover PID",                                      "nl": "Verwijder PID",                                    "fr": "Supprimer le PID",                                 "it": "Rimuovi PID",                                      "es": "Eliminar PID",                                     "pl": "Usunąć PID",                                       "uk": "Видалити PID",                                     "zh-cn": "删除PID"},
    "Remove script.js.Script_Name:": {                "en": "Remove script.js.Script_Name:",                    "de": "script.js.Script_Name entfernen:",                 "ru": "Удалить script.js.Script_Name:",                   "pt": "Remova script.js.Script_Name:",                    "nl": "Verwijder script.js.Script_Name:",                 "fr": "Supprimez script.js.Script_Name:",                 "it": "Rimuovi script.js.Script_Name:",                   "es": "Eliminar script.js.Script_Name:",                  "pl": "Usuń skrypt.js.Script_Name:",                      "uk": "Видалити script.js.Script_Name:",                  "zh-cn": "删除script.js.Script_Name："},
    "RemovePidTxt": {                                 "en": "The js controller version 2.0 or higher adds the PID in brackets to the front of logs, e.g. '(12234) Terminated: Without reason'. With this option the PIDs including brackets, like (1234), can be removed from the log lines.", "de": "Der js-Controller Version 2.0 oder größer fügt Logs teils vorne die PID in Klammern hinzu, also z.B. '(12345) Terminated: Without reason'. Durch Aktivierung dieser Option werden die PIDs inkl. Klammern, wie z.B. `(12345)`, aus den Logzeilen entfernt.", "ru": "Контроллер js версии 2.0 или выше добавляет PID в скобках в начале журналов, например, ", "pt": "O controlador js versão 2.0 ou superior adiciona o PID entre colchetes à frente dos logs, por exemplo ", "nl": "De js controller versie 2.0 of hoger voegt de PID tussen haakjes toe aan de voorkant van logs, b.v. ", "fr": "Le contrôleur js version 2.0 ou supérieure ajoute le PID entre parenthèses à l'avant des journaux, par ex. ", "it": "Il controller js versione 2.0 o successiva aggiunge il PID tra parentesi nella parte anteriore dei registri, ad es. ", "es": "El controlador js versión 2.0 o superior agrega el PID entre paréntesis al frente de los registros, p. ", "pl": "Wersja kontrolera z JS 2.0 lub wyżej, dodaje PID w nawiasach przed czasopisma, na przykład, '(12234) wygasa: bez przyczyny'. Za pomocą tej opcji Пидов, w tym w nawiasach, na przykład (1234), mogą być usunięte z wierszy dziennika.", "uk": "Контролер js версії 2.0 або новішої додає PID у дужках на початку журналів, наприклад. \"(12234) Припинено: без причини\". За допомогою цього параметра PID, включаючи дужки, наприклад (1234), можна видалити з рядків журналу.", "zh-cn": "Js控制器2.0版的或更高的增加PID在括号中，以前的记录，例如'(12234)终止：没有理由'. 有了这个选项Pid包括括号内，如(1234)，可以从中删除的日志线路。"},
    "RemoveScriptJsTxt": {                            "en": "Logs generated by the JavaScript adapter start with 'script.js.Script_Name: '. If this option is activated, this string will be removed from each log message.", "de": "Vom JavaScript-Adapter generierte Logs beginnen mit 'script.js.Script_Name:'. Wenn diese Option aktiviert ist, werden diese automatisch entfernt.", "ru": "Журналы, генерируемые адаптером JavaScript, начинаются с «script.js.Script_Name:». ", "pt": "Os logs gerados pelo adaptador JavaScript começam com 'script.js.Script_Name:'. ", "nl": "Logboeken die door de JavaScript-adapter zijn gegenereerd, beginnen met 'script.js.Script_Name:'. ", "fr": "Les journaux générés par l'adaptateur JavaScript commencent par «script.js.Script_Name:». ", "it": "I log generati dall'adattatore JavaScript iniziano con \"script.js.Script_Name:\". ", "es": "Los registros generados por el adaptador de JavaScript comienzan con 'script.js.Script_Name:'. ", "pl": "Dzienniki generowane przez adapter JavaScript zaczynają się od „script.js.Script_Name:”. ", "uk": "Журнали, створені адаптером JavaScript, починаються з 'script.js.Script_Name: '. Якщо цей параметр активовано, цей рядок буде видалено з кожного повідомлення журналу.", "zh-cn": "JavaScript适配器生成的日志以'script.js.Script_Name：'开头。"},
    "Replace date with 'Today' / 'Yesterday'": {      "en": "Replace date with 'Today' / 'Yesterday'",          "de": "Datum durch 'Heute' / 'Gestern' ersetzen",         "ru": "Заменить дату на «Сегодня» / «Вчера»",             "pt": "Substitua a data por 'Hoje' / 'Ontem'",            "nl": "Datum vervangen door 'Vandaag' / 'Gisteren'",      "fr": "Remplacer la date par «Aujourd'hui» / «Hier»",     "it": "Sostituisci la data con \"Oggi\" / \"Ieri\"",      "es": "Reemplazar fecha con 'Hoy' / 'Ayer'",              "pl": "Wymienić datę wczoraj 'dzisiaj'/\"",               "uk": "Замініть дату на «Сьогодні» / «Вчора»",            "zh-cn": "替换的日期与'今天，'/'昨天"},
    "ReplaceDateTxt": {                               "en": "In the filters, you can replace today's or yesterday's date with 'Today' or 'Yesterday' in the date format column by using hash characters (#). In these fields, other terms instead of 'Today'/'Yesterday' can be defined.", "de": "In den Filtern kann beim Datumsformat für mittels Hash-Zeichen (#) das heutige bzw. gestrige Datum durch 'Heute' bzw. 'Gestern' ersetzt werden. Hier können andere Begriffe statt 'Heute'/'Gestern' definiert werden.", "ru": "В фильтрах вы можете заменить сегодняшнюю или вчерашнюю дату на «Сегодня» или «Вчера» в столбце формата даты, используя хэш-символы (#). ", "pt": "Nos filtros, você pode substituir a data de hoje ou de ontem por 'Hoje' ou 'Ontem' na coluna de formato de data usando caracteres de hash (#). ", "nl": "In de filters kunt u de datum van vandaag of gisteren vervangen door 'Vandaag' of 'Gisteren' in de kolom voor datumnotatie door hashtekens (#) te gebruiken. ", "fr": "Dans les filtres, vous pouvez remplacer la date d'aujourd'hui ou d'hier par «Aujourd'hui» ou «Hier» dans la colonne de format de date en utilisant des caractères de hachage (#). ", "it": "Nei filtri, puoi sostituire la data di oggi o di ieri con \"Oggi\" o \"Ieri\" nella colonna del formato della data utilizzando i caratteri hash (#). ", "es": "En los filtros, puede reemplazar la fecha de hoy o de ayer con 'Hoy' o 'Ayer' en la columna de formato de fecha utilizando caracteres hash (#). ", "pl": "W filtrach, można zastąpić dzisiejszą lub wczorajszą datę z \"dziś\" lub \"na wczoraj\" w kolumnie date format za pomocą skrótu-symbole (#). W tych obszarach, inne określenia zamiast \"Dziś\" / \"wczoraj\" może być określony.", "uk": "У фільтрах ви можете замінити сьогоднішню або вчорашню дату на «Сьогодні» або «Вчора» у стовпці формату дати за допомогою символів решітки (#). У цих полях можна визначити інші терміни замість «Сьогодні»/«Вчора».", "zh-cn": "在过滤器，可以取代今天或昨天的日期与'今天或昨天的日期格式列通过使用哈希字(#). 在这些领域，其他条款而不是\"今天\"/'昨天可以定义。"},
