    "Sort descending (newest on top)": {              "en": "Sort descending (newest on top)",                  "de": "Absteigend sortieren (neuester oben)",             "ru": "Сортировать по убыванию (самый новый сверху)",     "pt": "Classificação decrescente (mais recente na parte superior)", "nl": "Aflopend sorteren (nieuwste bovenaan)",            "fr": "Tri décroissant (le plus récent en haut)",         "it": "Ordinamento decrescente (il più recente in alto)", "es": "Ordenar descendente (el más nuevo en la parte superior)", "pl": "Sortowanie malejąco (najnowsze na górze)",         "uk": "Сортувати за спаданням (найновіші зверху)",        "zh-cn": "按降序排序(最新的顶上)"},
    "SortTxt": {                                      "en": "If activated: sorts the log entries in descending order, newest at the top. If deactivated: Sorts the log entries in ascending order, i.e. oldest on top.", "de": "Wenn aktiviert: sortiert die Logeinträge absteigend, also neuester oben. Wenn deaktiviert: Sortiert die Logeinträge aufsteigend, also ältester oben.", "ru": "Если активировано: сортирует записи журнала в порядке убывания, самые новые вверху. ", "pt": "Se ativado: classifica as entradas do log em ordem decrescente, as mais recentes na parte superior. ", "nl": "Indien geactiveerd: sorteert de logboekvermeldingen in aflopende volgorde, de nieuwste bovenaan. ", "fr": "Si activé: trie les entrées du journal dans l'ordre décroissant, le plus récent en haut. ", "it": "Se attivato: ordina le voci del registro in ordine decrescente, le più recenti in alto. ", "es": "Si está activado: clasifica las entradas de registro en orden descendente, las más nuevas en la parte superior. ", "pl": "Jeśli aktywny jest: sortowanie rekordów dziennika w porządku malejącym, najnowsze na górze. Jeśli ta opcja jest wyłączona: sortuje wpisy w kolejności rosnącej, czyli stare góry.", "uk": "Якщо активовано: сортує записи журналу в порядку спадання, найновіші вгорі. Якщо вимкнено: сортує записи журналу в порядку зростання, тобто найстаріші зверху.", "zh-cn": "如果活化：各种各样的日志项目的排序，最新的顶部。 如果停用:各种各样的日志条目在上升顺序的，即最早在上面。"},
