    "With this you can add additional CSS in the JSON.": {"en": "With this you can add additional CSS in the JSON.", "de": "Damit können Sie zusätzliches CSS im JSON hinzufügen.", "ru": "При этом вы можете добавить дополнительный CSS в JSON.", "pt": "Com isso, você pode adicionar CSS adicional no JSON.", "nl": "Hiermee kun je extra CSS toevoegen in de JSON.",   "fr": "Avec cela, vous pouvez ajouter du CSS supplémentaire dans le JSON.", "it": "Con questo puoi aggiungere ulteriori CSS nel JSON.", "es": "Con esto puedes agregar CSS adicional en el JSON.", "pl": "Dzięki temu możesz dodać dodatkowy CSS w JSON.",   "uk": "Завдяки цьому ви можете додати додатковий CSS у JSON.", "zh-cn": "有了它，您可以在 JSON 中添加额外的 CSS。"},
