    "A detailed documentation with explanations and all further information can be found on our GitHub page:": {"en": "A detailed documentation with explanations and all further information can be found on our GitHub page:", "de": "Eine ausführliche Dokumentation mit Erläuterungen und allen weiteren Informationen finden Sie auf unserer GitHub-Seite:", "ru": "Подробную документацию с пояснениями и всю дополнительную информацию можно найти на нашей странице GitHub:", "pt": "Uma documentação detalhada com explicações e todas as informações adicionais podem ser encontradas em nossa página do GitHub:", "nl": "Een gedetailleerde documentatie met uitleg en alle verdere informatie is te vinden op onze GitHub-pagina:", "fr": "Une documentation détaillée avec des explications et toutes les informations complémentaires se trouvent sur notre page GitHub :", "it": "Una documentazione dettagliata con spiegazioni e tutte le ulteriori informazioni è disponibile sulla nostra pagina GitHub:", "es": "Puede encontrar una documentación detallada con explicaciones y toda la información adicional en nuestra página de GitHub:", "pl": "Szczegółową dokumentację z wyjaśnieniami i wszystkimi dodatkowymi informacjami można znaleźć na naszej stronie GitHub:", "uk": "Детальну документацію з поясненнями та всю додаткову інформацію можна знайти на нашій сторінці GitHub:", "zh-cn": "可以在我们的 GitHub 页面上找到包含解释和所有进一步信息的详细文档："},
